// export default Nav;
export const NavE = styled.div`
  height: 10vh;
  position: sticky;
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
`;
export const NavLogo = styled.img``;
export const NavItem = styled.li`
  margin: 0 1rem;
`;
export const NavMenu = styled.ul`
  list-style: none;
  display: flex;
  justify-content: space-between;
`;
